import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav className="navbar h-navbar fixed-top bg-info" style="{height: 50px; border-bottom: 1px solid lightgray;}">
      </nav>
    </div>
  );
}

export default App;
